double C3reg_pointlike_gg_softexp (double z, int nf, double muF_mH_ratio, int truncation, double power) {
  double l1mz = log(1-z);
  double lf = -2*log(muF_mH_ratio); // = log(mH2/muF2)
  double res = 0;
  //
  if(N3LOcoeffs_1::last_power != power) {
    reCoeff(N3LOcoeffs_1::eta3gg5,   N3LOcoeffs_1::eta35,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg4,   N3LOcoeffs_1::eta34,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg4L1, N3LOcoeffs_1::eta34L1, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg3,   N3LOcoeffs_1::eta33,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg3L1, N3LOcoeffs_1::eta33L1, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg3L2, N3LOcoeffs_1::eta33L2, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg2,   N3LOcoeffs_1::eta32,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg2L1, N3LOcoeffs_1::eta32L1, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg2L2, N3LOcoeffs_1::eta32L2, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg2L3, N3LOcoeffs_1::eta32L3, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg1,   N3LOcoeffs_1::eta31,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg1L1, N3LOcoeffs_1::eta31L1, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg1L2, N3LOcoeffs_1::eta31L2, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg1L3, N3LOcoeffs_1::eta31L3, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg0,   N3LOcoeffs_1::eta30,   power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg0L1, N3LOcoeffs_1::eta30L1, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg0L2, N3LOcoeffs_1::eta30L2, power, truncation);
    reCoeff(N3LOcoeffs_1::eta3gg0L3, N3LOcoeffs_1::eta30L3, power, truncation);
    N3LOcoeffs_1::last_power = power;
  }
  //
  for(int i=0; i<=truncation; i++) {
    res += N3LOcoeffs_1::eta35  [i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz*l1mz*l1mz;
    res += N3LOcoeffs_1::eta34  [i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz*l1mz;
    res += N3LOcoeffs_1::eta34L1[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz*l1mz * lf;
    res += N3LOcoeffs_1::eta33  [i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz;
    res += N3LOcoeffs_1::eta33L1[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz * lf;
    res += N3LOcoeffs_1::eta33L2[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz*l1mz * lf*lf;
    res += N3LOcoeffs_1::eta32  [i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz;
    res += N3LOcoeffs_1::eta32L1[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz * lf;
    res += N3LOcoeffs_1::eta32L2[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz * lf*lf;
    res += N3LOcoeffs_1::eta32L3[i] * pow(1-z,i) * pow(z,-power) * l1mz*l1mz * lf*lf*lf;
    res += N3LOcoeffs_1::eta31  [i] * pow(1-z,i) * pow(z,-power) * l1mz;
    res += N3LOcoeffs_1::eta31L1[i] * pow(1-z,i) * pow(z,-power) * l1mz * lf;
    res += N3LOcoeffs_1::eta31L2[i] * pow(1-z,i) * pow(z,-power) * l1mz * lf*lf;
    res += N3LOcoeffs_1::eta31L3[i] * pow(1-z,i) * pow(z,-power) * l1mz * lf*lf*lf;
    res += N3LOcoeffs_1::eta30  [i] * pow(1-z,i) * pow(z,-power);
    res += N3LOcoeffs_1::eta30L1[i] * pow(1-z,i) * pow(z,-power) * lf;
    res += N3LOcoeffs_1::eta30L2[i] * pow(1-z,i) * pow(z,-power) * lf*lf;
    res += N3LOcoeffs_1::eta30L3[i] * pow(1-z,i) * pow(z,-power) * lf*lf*lf;
  }
  return res;
}
double C3reg_pointlike_gg_smallx(double z, int truncation) {
  double res = pow(-log(z),5)/z;
  for(int i=0; i<=truncation; i++) res -= N3LOcoeffs_1::log5z_softexp[i] * pow(z-1,i);
  return res * pow(2.*3,3)/120.;  // (2CA)^3/5!
}


