double C3reg_pointlike_gg_heexp (double z, int nf, double muF_mH_ratio, int truncation) {
  double lz = log(z);
  double lf = -2*log(muF_mH_ratio); // = log(mH2/muF2)
  double res = 0;
  //
  for(int i=0; i<=truncation; i++) {
    res += N3LOcoeffs_0::eta3gg5  [i] * pow(z   ,i) * lz*lz*lz*lz*lz;
    //
    res += N3LOcoeffs_0::eta3gg4  [i] * pow(z   ,i) * lz*lz*lz*lz;
    res += N3LOcoeffs_0::eta3gg4L1[i] * pow(z   ,i) * lz*lz*lz*lz * lf;
    //
    res += N3LOcoeffs_0::eta3gg3  [i] * pow(z*10,i) * lz*lz*lz;
    res += N3LOcoeffs_0::eta3gg3L1[i] * pow(z   ,i) * lz*lz*lz * lf;
    res += N3LOcoeffs_0::eta3gg3L2[i] * pow(z   ,i) * lz*lz*lz * lf*lf;
    //
    res += N3LOcoeffs_0::eta3gg2  [i] * pow(z*10,i) * lz*lz;
    res += N3LOcoeffs_0::eta3gg2L1[i] * pow(z   ,i) * lz*lz * lf;
    res += N3LOcoeffs_0::eta3gg2L2[i] * pow(z   ,i) * lz*lz * lf*lf;
    res += N3LOcoeffs_0::eta3gg2L3[i] * pow(z   ,i) * lz*lz * lf*lf*lf;
    //
    res += N3LOcoeffs_0::eta3gg1  [i] * pow(z*10,i) * lz;
    res += N3LOcoeffs_0::eta3gg1L1[i] * pow(z   ,i) * lz * lf;
    res += N3LOcoeffs_0::eta3gg1L2[i] * pow(z   ,i) * lz * lf*lf;
    res += N3LOcoeffs_0::eta3gg1L3[i] * pow(z   ,i) * lz * lf*lf*lf;
    //
    res += N3LOcoeffs_0::eta3gg0  [i] * pow(z*10,i);
    res += N3LOcoeffs_0::eta3gg0L1[i] * pow(z   ,i) * lf;
    res += N3LOcoeffs_0::eta3gg0L2[i] * pow(z   ,i) * lf*lf;
    res += N3LOcoeffs_0::eta3gg0L3[i] * pow(z   ,i) * lf*lf*lf;
  }
  return res / (1-z*z)/z;
}

