double C3reg_pointlike_gg_midexp (double z, int nf, double muF_mH_ratio, int truncation) {
  double lf = -2*log(muF_mH_ratio); // = log(mH2/muF2)
  double res = 0;
  //
  for(int i=0; i<=truncation; i++) {
    res += N3LOcoeffs_05::eta3gg  [i] * pow(1-2*z,i);
    res += N3LOcoeffs_05::eta3ggL1[i] * pow(1-2*z,i) * lf;
    res += N3LOcoeffs_05::eta3ggL2[i] * pow(1-2*z,i) * lf*lf;
    res += N3LOcoeffs_05::eta3ggL3[i] * pow(1-2*z,i) * lf*lf*lf;
  }
  return res / (1-z)/(1-z)/z/z/16.;
}

