    res += eta3  [i] * pow(1-2*z,i);
    res += eta3L1[i] * pow(1-2*z,i) * lf;
    res += eta3L2[i] * pow(1-2*z,i) * lf*lf;
    res += eta3L3[i] * pow(1-2*z,i) * lf*lf*lf;
